import './Board.css';
import React from 'react';
import setBoard from './App.js';
import onClickButton from './App.js';

export function Board(props) {
  return (
    <div class="board">
        <div class="box" onClick={() => props.name(0)}>{props.val[0]}</div>
        <div class="box" onClick={() => props.name(1)}>{props.val[1]}</div>
        <div class="box" onClick={() => props.name(2)}>{props.val[2]}</div>
        <div class="box" onClick={() => props.name(3)}>{props.val[3]}</div>
        <div class="box" onClick={() => props.name(4)}>{props.val[4]}</div>
        <div class="box" onClick={() => props.name(5)}>{props.val[5]}</div>
        <div class="box" onClick={() => props.name(6)}>{props.val[6]}</div>
        <div class="box" onClick={() => props.name(7)}>{props.val[7]}</div>
        <div class="box" onClick={() => props.name(8)}>{props.val[8]}</div>
    </div>
  );
}
